import React, { useEffect } from 'react';
import './ProjectSection.css';

function ProjectSection() {
  useEffect(() => {
    const checkboxes = document.querySelectorAll('input[type="checkbox"]');
    const items = document.getElementById('items').querySelectorAll('.card');

    function filterItems() {
      const selectedOptions = Array.from(checkboxes)
        .filter(checkbox => checkbox.checked)
        .map(checkbox => checkbox.value);

      items.forEach(item => {
        if (selectedOptions.length === 0 || selectedOptions.includes(item.dataset.category)) {
          item.classList.add('show');
        } else {
          item.classList.remove('show');
        }
      });
    }

    checkboxes.forEach(checkbox => checkbox.addEventListener('change', filterItems));

    // Call filterItems once to show all items initially
    filterItems();

    return () => {
      checkboxes.forEach(checkbox => checkbox.removeEventListener('change', filterItems));
    };
  }, []);

  return (
    <>
      <div>
        <label>Filter:</label>
        <div>
          <input type="checkbox" id="fruits" defaultValue="fruits" />
          <label htmlFor="fruits">Fruits</label>
        </div>
        <div>
          <input type="checkbox" id="cars" defaultValue="cars" />
          <label htmlFor="cars">Cars</label>
        </div>
        <div>
          <input type="checkbox" id="people" defaultValue="people" />
          <label htmlFor="people">People</label>
        </div>
      </div>
      <div id="items">
        <h2>Items:</h2>
        <ul>
          <li className="card fruits" data-category="fruits">
            <div className="card-content">
              <h3>Apple</h3>
              <p>Some description about an apple.</p>
            </div>
          </li>
          <li className="card fruits" data-category="fruits">
            <div className="card-content">
              <h3>Banana</h3>
              <p>Some description about a banana.</p>
            </div>
          </li>
          <li className="card cars" data-category="cars">
            <div className="card-content">
              <h3>Tesla</h3>
              <p>Some description about a Tesla.</p>
            </div>
          </li>
          <li className="card cars" data-category="cars">
            <div className="card-content">
              <h3>BMW</h3>
              <p>Some description about a BMW.</p>
            </div>
          </li>
          <li className="card people" data-category="people">
            <div className="card-content">
              <h3>John</h3>
              <p>Some description about John.</p>
            </div>
          </li>
          <li className="card people" data-category="people">
            <div className="card-content">
              <h3>Emily</h3>
              <p>Some description about Emily.</p>
            </div>
          </li>
        </ul>
      </div>
    </>
  );
}

export default ProjectSection;
